import { Component } from "react";
import "./input.css";

export default class Input extends Component {
  render() {
    const { lable, type, name, placeholder, value, onChange } = this.props;
    return (
      <>
        <label htmlFor={name}>{lable}</label>
        <input
          type={type}
          id={name}
          name={name}
          placeholder={placeholder}
          value={value}
          onChange={onChange}
        />
      </>
    );
  }
}
